        return <Empty ref={ref} />;
    } else if (objectIndex >= 4 && objectIndex <= 9) {
        return <Tree_1 ref={ref} />;
    } else if (objectIndex >= 0 && objectIndex <= 3) {
        return <Tree_2 ref={ref} />;
    } else {
        return null;
    }
});

